--1
--UPDATE ComplementoConhecimento SET IndFaturaEstadia = 'A Faturar' WHERE NumSeqConhecto = " & rsCTRC_CR!NumSeqConhecto

----UPDATE ComplementoConhecimento SET IndFaturaEstadia = 'A Faturar' WHERE NumSeqConhecto IN(
select NumSeqConhecto from ComplementoConhecimento where NumSeqConhecto IN (
SELECT DISTINCT Sequencial
--ContasReceber.CodContasReceber, ContasReceber.DataEmissao, ContasReceber.CodCliente, Clientes.RazaoSocial, ContasReceber.DataVencimento, ContasReceber.Saldo, ContasReceber.ValorReceber, ContasReceber.Situacao, TiposContasReceber.DescTipoContasRec, ContasReceber.NumDocumento 
FROM ConhecimentosTransporte 
INNER JOIN ConhecimentosContasReceber ON ConhecimentosTransporte.Sequencial = ConhecimentosContasReceber.NumSeqConhecto 
RIGHT OUTER JOIN ContasReceber ON ConhecimentosContasReceber.CodContasReceber = ContasReceber.CodContasReceber
INNER JOIN Clientes ON ContasReceber.CodCliente = Clientes.CodCliente
INNER JOIN TiposContasReceber ON ContasReceber.CodTipoContasRec = TiposContasReceber.CodTipoContasRec 
LEFT OUTER JOIN Clientes_Endereco ON Clientes_Endereco.CodCliente = ContasReceber.CodCliente AND TipoEndereco = 'Cobrança' 
LEFT JOIN Clientes_Complemento ON Clientes.CodCliente = Clientes_Complemento.CodCliente 
LEFT OUTER JOIN ConhecimentosTerceiros_ContasReceber ON ContasReceber.CodContasReceber = 
ConhecimentosTerceiros_ContasReceber.CodContasReceber
WHERE ContasReceber.DataEmissao BETWEEN '10/29/2024 00:00:00' AND '10/29/2024 23:59:29' AND ContasReceber.CodTipoReceita = 5 AND ContasReceber.CodFilialOrigem = 'CUB')
--ORDER BY ContasReceber.DataEmissao DESC, ContasReceber.DataVencimento DESC

